import React from "react";
import { View, Button, Text, StyleSheet } from "react-native";
import { createStackNavigator } from "@react-navigation/stack";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";


const Home2 = ({navigation}) => {
    return (
      <View style={styles.center}>
        <Text>This is the home screen</Text>
        <Button title="Go to About Screen" onPress={() => navigation.navigate('SecondScreen')} />
      </View>
    );
};

const About = () => {
    return (
        <View style={styles.center}>
        <Text>This is the about screen</Text>
        </View>
    );
};

const Contact = () => {
    return (
      <View style={styles.center}>
        <Text>This is the contact screen</Text>
      </View>
    );
};

const styles = StyleSheet.create({
    center: {
      flex: 1,
      justifyContent: "center",
      alignItems: "center",
      textAlign: "center",
    },
  });

const Stack = createStackNavigator();

const MainStackNavigator = () => {
    return (
      <Stack.Navigator>
        <Stack.Screen name="Home" component={Home2} />
        <Stack.Screen name="About" component={About} />
        <stack.Screen name="tabs" component={BottomTabNavigator}/>
      </Stack.Navigator>
    );
}


const Stack2 = createStackNavigator();

const ContactStackNavigator = () => {
    return (
      <Stack2.Navigator screenOptions={screenOptionStyle}>
        <Stack2.Screen name="Contact" component={Contact} />
      </Stack2.Navigator>
    );
}

const Tab = createBottomTabNavigator();

const BottomTabNavigator = () => {
  return (
    <Tab.Navigator>
      <Tab.Screen name="Home" component={MainStackNavigator} />
      <Tab.Screen name="Contact" component={ContactStackNavigator} />
    </Tab.Navigator>
  );
};

export { MainStackNavigator, ContactStackNavigator, BottomTabNavigator };
